import { BrowserRouter, Route, Routes } from 'react-router-dom';
import {useNavigate} from "react-router-dom";
import './App.css';
import Login from './component/login';
import Community from './pages/Community';
import Mypage from './pages/Mypage';
import RefrigeratorClose from './pages/RefrigeratorClose';
import RefrigeratorOpen from './pages/RefrigeratorOpen';

function App() {
  const navigate = useNavigate();

  const goOpen = () => {
    navigate(`/open`)
  }

  const goCommunity = () => {
    navigate(`/community`)
  }

  const goMypage = () => {
    navigate(`/mypage`)
  }

  return (
    <><header>
      <div className="head_btn_left">
        <button className="header_refrigerator" onClick={goOpen}>
          냉장고
        </button>
      </div>
      <div className="head_middle">
        <button className="header_Community" onClick={goCommunity}>
          커뮤니티
        </button>
      </div>
      <div className="head_btn_right">
        <button className="header_Mypage" onClick={goMypage}>
          마이페이지
        </button>
      </div>
      <div className="head_userinfo">
        환영합니다.
      </div>
    </header>
    <BrowserRouter>
        <div className="App">
          <Routes>
            <Route path='/' element={<Login />} />
            <Route path='/close' element={<RefrigeratorClose />} />
            <Route path='/open' element={<RefrigeratorOpen />} />
            <Route path='/community' element={<Community />} />
            <Route path='/mypage' element={<Mypage />} />
          </Routes>
        </div>
      </BrowserRouter></>
    
  );
}

export default App;
